// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const containerStyle = {
    backgroundColor: '#282c34',
    color: '#fff',
    padding: '1rem 2rem'
  };

  const titleStyle = {
    fontSize: '1.8rem',
    fontWeight: 'bold',
    marginBottom: '0.5rem',
    textAlign: 'center'
  };

  const navLinksStyle = {
    display: 'flex',
    justifyContent: 'center',
    gap: '2rem'
  };

  const linkStyle = {
    color: '#fff',
    textDecoration: 'none',
    fontWeight: '500',
    transition: 'color 0.3s ease'
  };

  return (
    <div style={containerStyle}>
      <div style={titleStyle}>DAA Project</div>
      <nav style={navLinksStyle}>
        <Link to="/" style={linkStyle}>Intro</Link>
        <Link to="/algo/1" style={linkStyle}>Algorithm 1</Link>
        <Link to="/algo/2" style={linkStyle}>Algorithm 2</Link>
        <Link to="/algo/3" style={linkStyle}>Algorithm 3</Link>
      </nav>
    </div>
  );
};

export default Navbar;
